import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Navigation from './components/Navigation';
import { initDarkMode, setupScrollToTop, setupLazyLoading, setupScrollAnimation, setupEmailValidation } from './utils';

function App() {
  useEffect(() => {
    initDarkMode();
    setupScrollToTop();
    setupLazyLoading();
    setupScrollAnimation();
    setupEmailValidation();
  }, []);

  return (
    <Router>
      <div className="App">
        <Navigation />
        <Routes>
          {/* Your routes */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
